selector_to_html = {"a[href=\"#fork-of-microsoft-vscode-textmate\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Fork of <a class=\"tippyAnchor reference external\" href=\"https://github.com/microsoft/vscode-textmate\"><code class=\"docutils literal notranslate\"><span class=\"pre\">microsoft/vscode-textmate</span></code></a><a class=\"headerlink\" href=\"#fork-of-microsoft-vscode-textmate\" title=\"Link to this heading\">#</a></h1><p>Changes make in this fork:</p>"}
skip_classes = ["headerlink", "sd-stretched-link"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(`article.bd-article ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,

            });
        };
    };
    console.log("tippy tips loaded!");
};
